<div class="Parallax GParallax1"><div class="Img Binary"><div class="Caption"><a href="#"><div class="Text">Programmation web en PHP<br></div></a></div></div><div class="Body2 Orange"><br>Le but de ce tutoriel est de vous apprendre la programmation web en <b>PHP</b>.<br>Produit par <b>Gérard KESSE</b>.<br><br><div class="Content0 GSummary1"><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Introduction">Introduction</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Fondamentaux">Fondamentaux</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Tableaux">Tableaux</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Tableaux-associatifs">Tableaux associatifs</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Programmation-orientee-objet">Programmation orientée objet</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Patrons-de-conception">Patrons de conception</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Methodes-magiques">Méthodes magiques</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#Systeme-d-hebergement-de-fichiers">Système d'hébergement de fichiers</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#LazyLoad">LazyLoad</a></div><div class="Item4"><span class="Icon10 fa fa-book"></span><a class="Link4" href="#GTmetrix">GTmetrix</a></div></div><br></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Introduction"><a class="Link3" href="#">Introduction</a></h1><div class="Body3"><br><b>PHP </b>est un langage de programmation libre, principalement utilisé pour produire des pages Web dynamiques via un serveur HTTP, mais pouvant également fonctionner comme n'importe quel langage interprété de façon locale. PHP est un langage impératif orienté objet. PHP a permis de créer un grand nombre de sites web célèbres, comme Facebook et Wikipédia. Il est considéré comme une des bases de la création de sites web dits dynamiques mais également des applications web. <br><br><div class="Img3 GImage"><img id="img_1646070630785" alt="img_1646070630785" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Installer-le-plugin-PHP-dans-Eclipse"><a class="Link3" href="#">Installer le plugin PHP dans Eclipse</a></h1><div class="Body3"><br>Installer le plugin PHP dans Eclipse.<br><br><b>Eclipse </b>est un projet, décliné et organisé en un ensemble de sous-projets de développements logiciels, de la fondation Eclipse visant à développer un environnement de production de logiciels libre qui soit extensible, universel et polyvalent, en s'appuyant principalement sur Java. Son objectif est de produire et fournir des outils pour la réalisation de logiciels, englobant les activités de programmation (notamment environnement de développement intégré et frameworks) mais aussi d'AGL recouvrant modélisation, conception, test, gestion de configuration, reporting… Son EDI, partie intégrante du projet, vise notamment à supporter tout langage de programmation à l'instar de Microsoft Visual Studio.<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><h2 class="Title7 GTitle2" id="Installer-le-plugin-PHP-dans-Eclipse-Ouvrir-le-gestionnaire-de-plugin"><a class="Link9" href="#Installer-le-plugin-PHP-dans-Eclipse">Ouvrir le gestionnaire de plugin</a></h2><br><div class="Img3 GImage"><img id="img_1646072473316" alt="img_1646072473316" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Installer-le-plugin-PHP-dans-Eclipse-Ouvrir-le-menu-ajouter-un-plugin"><a class="Link9" href="#Installer-le-plugin-PHP-dans-Eclipse">Ouvrir le menu ajouter un plugin</a></h2><br><div class="Img3 GImage"><img id="img_1646072626232" alt="img_1646072626232" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Installer-le-plugin-PHP-dans-Eclipse-Ajouter-l-URL-du-plugin-PHP"><a class="Link9" href="#Installer-le-plugin-PHP-dans-Eclipse">Ajouter l'URL du plugin PHP</a></h2><br><div class="Img3 GImage"><img id="img_1646072859305" alt="img_1646072859305" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Installer-le-plugin-PHP-dans-Eclipse-Ajouter-le-plugin-PHP"><a class="Link9" href="#Installer-le-plugin-PHP-dans-Eclipse">Ajouter le plugin PHP</a></h2><br><div class="Img3 GImage"><img id="img_1646073041652" alt="img_1646073041652" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Creer-un-projet-PHP-dans-Eclipse"><a class="Link3" href="#">Créer un projet PHP dans Eclipse</a></h1><div class="Body3"><br>Créer un projet PHP dans Eclipse.<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><h2 class="Title7 GTitle2" id="Creer-un-projet-PHP-dans-Eclipse-Ouvrir-le-menu-nouveau-projet"><a class="Link9" href="#Creer-un-projet-PHP-dans-Eclipse">Ouvrir le menu nouveau projet</a></h2><br><div class="Img3 GImage"><img id="img_1646076113878" alt="img_1646076113878" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Creer-un-projet-PHP-dans-Eclipse-Choisir-le-projet-PHP"><a class="Link9" href="#Creer-un-projet-PHP-dans-Eclipse">Choisir le projet PHP</a></h2><br><div class="Img3 GImage"><img id="img_1646076268140" alt="img_1646076268140" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Creer-un-projet-PHP-dans-Eclipse-Terminer-la-creation-du-projet"><a class="Link9" href="#Creer-un-projet-PHP-dans-Eclipse">Terminer la création du projet</a></h2><br><div class="Img3 GImage"><img id="img_1646076573657" alt="img_1646076573657" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Charger-un-projet-PHP-dans-Eclipse"><a class="Link3" href="#">Charger un projet PHP dans Eclipse</a></h1><div class="Body3"><br>Charger un projet PHP dans Eclipse.<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><h2 class="Title7 GTitle2" id="Charger-un-projet-PHP-dans-Eclipse-Configurer-les-fichiers-projet-Eclipse"><a class="Link9" href="#Charger-un-projet-PHP-dans-Eclipse">Configurer les fichiers projet Eclipse</a></h2><br><div class="Img3 GImage"><img id="img_1646078015619" alt="img_1646078015619" src="data:image/png;base64,"></div><br>Copier/Coller les fichiers projet Eclipse dans le répertoire source PHP.<br><br><h2 class="Title7 GTitle2" id="Charger-un-projet-PHP-dans-Eclipse-Ouvrir-le-menu-importer-projet"><a class="Link9" href="#Charger-un-projet-PHP-dans-Eclipse">Ouvrir le menu importer projet</a></h2><br><div class="Img3 GImage"><img id="img_1646071691643" alt="img_1646071691643" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Charger-un-projet-PHP-dans-Eclipse-Choisir-un-projet-existant"><a class="Link9" href="#Charger-un-projet-PHP-dans-Eclipse">Choisir un projet existant</a></h2><br><div class="Img3 GImage"><img id="img_1646071741382" alt="img_1646071741382" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Charger-un-projet-PHP-dans-Eclipse-Terminer-le-chargement-du-projet"><a class="Link9" href="#Charger-un-projet-PHP-dans-Eclipse">Terminer le chargement du projet</a></h2><br><div class="Img3 GImage"><img id="img_1646078807912" alt="img_1646078807912" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Charger-un-projet-PHP-dans-Eclipse-Resultat"><a class="Link9" href="#Charger-un-projet-PHP-dans-Eclipse">Résultat</a></h2><br><div class="Img3 GImage"><img id="img_1646078960708" alt="img_1646078960708" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Installer-Xdebug-dans-WampServer"><a class="Link3" href="#">Installer Xdebug dans WampServer</a></h1><div class="Body3"><br>Installer Xdebug dans WampServer.<br><br>Xdebug est une extension PHP qui fournit des fonctionnalités de débogage et de profilage. Il utilise le protocole de débogage DBGp. Les informations de débogage que Xdebug peut fournir incluent les éléments suivants : traces de pile et de fonction dans les messages d'erreur avec :<br>affichage complet des paramètres pour les fonctions définies par l'utilisateur nom de fonction, nom de fichier et indications de ligne; soutien aux fonctions des membres; allocation de mémoire; protection pour les récursions infinies. Xdebug fournit également : informations de profilage pour les scripts; analyse de couverture de code; capacités pour déboguer vos scripts de manière interactive avec un débogueur frontal. Xdebug est également disponible via le PECL.<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><h2 class="Title7 GTitle2" id="Installer-Xdebug-dans-WampServer-Copier-les-infos-PHP"><a class="Link9" href="#Installer-Xdebug-dans-WampServer">Copier les infos PHP</a></h2><br><div class="Content0 GSummary3"><div class="Row26">Summary 3</div></div><br><h3 class="GTitle3" id="Installer-Xdebug-dans-WampServer-Executer-le-code-phpinfo-Definir-le-code-phpinfo"><a class="Title8" href="#Installer-Xdebug-dans-WampServer-Executer-le-code-phpinfo">Définir le code phpinfo</a></h3><br><div class="Img3 GImage"><img id="img_1646084346399" alt="img_1646084346399" src="data:image/png;base64,"></div><br><h3 class="GTitle3" id="Installer-Xdebug-dans-WampServer-Copier-les-infos-php-Executer-le-code-phpinfo"><a class="Title8" href="#Installer-Xdebug-dans-WampServer-Copier-les-infos-php">Exécuter le code phpinfo</a></h3><br><div class="Img3 GImage"><img id="img_1646084412673" alt="img_1646084412673" src="data:image/png;base64,"></div><br>Copier tout le contenu de cette page (Ctrl + A puis Ctrl + C)<br><br><h2 class="Title7 GTitle2" id="Installer-Xdebug-dans-WampServer-Analyser-les-infos-PHP-dans-Xdebug"><a class="Link9" href="#Installer-Xdebug-dans-WampServer">Analyser les infos PHP dans Xdebug</a></h2><br><div class="Img3 GImage"><img id="img_1646114594513" alt="img_1646114594513" src="data:image/png;base64,"></div><br>- (1) : Coller les infos PHP dans l'écran d'analyse Xdebug. <br>- (2) : Appuyer sur le bouton Analyser ma sortite phpinfo().<br><br><h2 class="Title7 GTitle2" id="Installer-Xdebug-dans-WampServer-Observer-les-informations-de-configuration"><a class="Link9" href="#Installer-Xdebug-dans-WampServer">Observer les informations de configuration</a></h2><br><div class="Img3 GImage"><img id="img_1646116145936" alt="img_1646116145936" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Installer-Xdebug-dans-WampServer-Observer-les-instructions-d-installation"><a class="Link9" href="#Installer-Xdebug-dans-WampServer">Observer les instructions d'installation</a></h2><br><div class="Img3 GImage"><img id="img_1646116259113" alt="img_1646116259113" src="data:image/png;base64,"></div><br>- Suivre les instructions d'installation<br>- Installer Xdebug<br><br><h2 class="Title7 GTitle2" id="Installer-Xdebug-dans-WampServer-Configurer-Xdebug"><a class="Link9" href="#Installer-Xdebug-dans-WampServer">Configurer Xdebug</a></h2><br><div class="Img3 GImage"><img id="img_1646116945857" alt="img_1646116945857" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="Content2 GTitle1"><div class="MainBlock2"><div class="Content"><h1 class="Title2 Center" id="Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse"><a class="Link3" href="#">Déboguer un projet PHP avec Xdebug dans Eclipse</a></h1><div class="Body3"><br>Déboguer un projet PHP avec Xdebug dans Eclipse.<br><br><div class="Content0 GSummary2"><div class="Row26">Summary 2</div></div><br><br><br><br><br><h2 class="Title7 GTitle2" id="Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse-Ouvrir-le-menu-configuration-de-debogage"><a class="Link9" href="#Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse">Ouvrir le menu configuration de débogage</a></h2><br><div class="Img3 GImage"><img id="img_1646081346947" alt="img_1646081346947" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse-Creer-une-nouvelle-configuration-de-debogage"><a class="Link9" href="#Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse">Créer une nouvelle configuration de débogage</a></h2><br><div class="Img3 GImage"><img id="img_1646082923211" alt="img_1646082923211" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse-Acceder-a-la-nouvelle-configuration"><a class="Link9" href="#Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse">Accéder à la nouvelle configuration</a></h2><br><div class="Img3 GImage"><img id="img_1646083004929" alt="img_1646083004929" src="data:image/png;base64,"></div><br><h2 class="Title7 GTitle2" id="Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse-Configurer-le-serveur-de-debogage"><a class="Link9" href="#Deboguer-un-projet-PHP-avec-Xdebug-dans-Eclipse">Configurer le serveur de débogage</a></h2><br><div class="Img3 GImage"><img id="img_1646083405634" alt="img_1646083405634" src="data:image/png;base64,"></div><br><br></div></div></div></div><br>